INSERT INTO `mail_template` (`templateid`, `from_mail`, `from_name`, `subject`, `message`, `status`) VALUES
(1, 'admin@yourcompany.com', 'Administrator', '1', '<p>Dear [FIRSTNAME],</p>\n\n<p>This is to confirm that your account verification had done successfully in #sitename. Now you can login using your User Name and Password.</p>\n\n<p>&nbsp;</p>\n\n<p>Username : [USERNAME]</p>\n\n<p>Username : [PASSWORD]</p>\n\n<p>Copy and paste this link to your browser for Login:</p>\n\n<p>[URL]</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemail</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>', '1'),
(2, 'admin@yourcompany.com', 'Administrator', '2', '<p>Dear [FIRSTNAME],</p><p>Your account has been successfully created.</p><p>PASSWORD: [PASSWORD]</p><p>Click this link for account activation: <a href=\"[URL]\">[URL]</a></p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemail</p><p>Thanks and Regards</p><p>Admin #sitename</p>', '1'),
(3, 'admin@yourcompany.com', 'Administrator', '3', '<p>Dear [FIRSTNAME],</p>\n\n<p>Your Password&nbsp; has been reseted Successfully.</p>\n\n<p>&nbsp;</p>\n\n<p>Password - [PASSWORD]</p>\n\n<p>&nbsp;</p>\n\n<p>Copy and paste this link to your browser for Login:</p>\n\n<p>#verfyurl</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemail</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>', '1'),
(4, 'admin@yourcompany.com', 'Administrator', '4', '<p>Dear [FIRSTNAME],</p>\n\n<p>Your Profile has been successfully updated.</p>\n\n<p>&nbsp;</p>\n\n<p>Please check you profile and account detail.</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemail</p>\n\n<p>&nbsp;</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>', '1'),
(5, 'admin@admin.com', 'administrator', '5', '<p>Dear [FIRSTNAME],</p>\r\n\r\n<p>Thank You for your investment with us.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For your convenience, we have included a copy of your Investment below.</p>\r\n\r\n<p>Investment Amount : [AMT] USD</p>\r\n\r\n<p>Plan Name : [PLAN]</p>\r\n\r\n<p>Payment Mode : [PAYMENT]</p>\r\n\r\n<p>Transaction Id : [transid]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Copy and paste this link to your browser for Login:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#verfyurl</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\r\n\r\n<p>Thanks and Regards</p>\r\n\r\n<p>Admin #sitename</p>\r\n', '1'),
(6, 'finance@yourcompany.biz', 'administrator', '6', '<p>Dear [FIRSTNAME],</p>\r\n\r\n<p>Your payout request made successfully.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For your convenience, we have included a details of payout request below.</p>\r\n\r\n<p>Payout Amount : [TXTAMT] USD</p>\r\n\r\n<p>Payout request date : [WITHDRAWDATE]</p>\r\n\r\n<p>Batch Number : [transid]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\r\n\r\n<p>Thanks and Regards</p>\r\n\r\n<p>Admin #sitename</p>', '1'),
(7, 'finance@yourcompany.biz', 'administrator', '7', '<p>Dear [FIRSTNAME],</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Congratulations and welcome to the #sitename Program! You have been approved as an #sitename. To access your #sitename account, please click on the following link and enter your username and password as provided below</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The following are your login details</p>\r\n\r\n<p>Username : [USERNAME]</p>\r\n\r\n<p>Password : [PASSWORD]</p>\r\n\r\n<p>Your Referral ID : [REFERRAL_ID]</p>\r\n\r\n<p>Your Referral Link : [REFERRAL_LINK]</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Copy and paste this link to your browser for Login:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>#verfyurl</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\r\n\r\n<p>Thanks and Regards</p>\r\n\r\n<p>Admin #sitename</p>\r\n', '1'),
(8, 'finance@yourcompany.biz', 'administrator', '8', '<p>Hello [FIRSTNAME],</p>\n\n<p>&nbsp;</p>\n\n<p>Congratulations and welcome to the #sitename ! Your Deposit has made successfully in #sitename.</p>\n\n<p>&nbsp;</p>\n\n<p>The following are your deposit details.</p>\n\n<p>Amount : #amt</p>\n\n<p>Payment Gateway : #payement</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>\n', '1'),
(9, 'finance@yourcompany.biz', 'administrator', '9', '<p>Dear [FIRSTNAME],</p>\r\n\r\n<p>Welcome to the #sitename !This is to confirm you that your payment has made successfully in #sitename.</p>\r\n\r\n<p>The following are your payment details</p>\r\n\r\n<p>Amount : #amt</p>\r\n\r\n<p>Payment Gateway : #payement</p>\r\n\r\n<p>Copy and paste this link to your browser for Login:</p>\r\n\r\n<p>#verfyurl</p>\r\n\r\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks and Regards</p>\r\n\r\n<p>Admin #sitename</p>\r\n', '1'),
(10, 'finance@yourcompany.biz', 'administrator', '10', '<p>Hello [FIRSTNAME],</p>\n\n<p>&nbsp;</p>\n\n<p>Your withdraw made successfully.</p>\n\n<p>&nbsp;</p>\n\n<p>For your convenience, we have included a details of withdraw below.</p>\n\n<p>Payout Amount : [TXTAMT] USD</p>\n\n<p>Payout date : [WITHDRAWDATE]</p>\n\n<p>Batch Number : [transid]</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>', '1'),
(11, 'admin@yourcompany.com', 'administrator', '14', '<p>Dear [FIRSTNAME],</p>\n\n<p>Ticket From #sitename</p>\n\n<p>&nbsp;</p>\n\n<p>Ticket Number : #ticketno</p>\n\n<p>Subject: #subject</p>\n\n<p>Status: #status</p>\n\n<p>Message: #content</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin</p>\n\n<p>#adminemill</p>\n', '1'),
(12, 'admin@yourcompany.com', 'administrator', '16', '<p>Dear [NAME],</p>\n\n<p>Your Enquiry form has been send to admin successfully. we will contact soonly.</p>\n\n<p>&nbsp;</p>\n\n<p>If you have any questions about your account or any other matter, please feel free to contact us at #adminemill</p>\n\n<p>Thanks and Regards</p>\n\n<p>Admin #sitename</p>', '1'),
(13, 'admin@yourcompany.com', 'administrator', '17', '<p>Dear Admin,</p>\n\n<p>You have received the Enquiry Mail from user. The follwoing are mail details.</p>\n\n<p>&nbsp;</p>\n\n<p>Name : [NAME]</p>\n\n<p>Email Address : [EMAIL]</p>\n\n<p>Subject : [SUBJECT]</p>\n\n<p>Message : [MESSAGE]</p>\n\n<p>&nbsp;</p>', '1'),
