(105, 1, 'Privacy', 'privacy', '<div class=\"agreementCon\">\n<p class=\"agreementConFooter\" style=\"padding:24px 0 0 0;\">This Privacy Policy applies to all related service of Binance. Binance respects and will protect the privacy of all users of the Binance platform. In order to provide you with more accurate and personalized services, Binance will use and disclose your personal information in accordance to this privacy policy. Except as otherwise stated in this privacy policy, Binance will not disclose or provide any information to third party sources without prior consent from the user or as required by law. By using any part of the Binance platform, you have agreed to the contents of this privacy policy.</p>\n\n<p class=\"agreementConSubHeader\">1. Applying Range</p>\n\n<p>When you register or activate an account on the Binance platform, you must provide the personal information of the individual registering on the Binance platform, enterprise name, and other relevant business registration information as required by law.</p>\n\n<p>When you use Binance platform services, Binance automatically receives and records information received from your browser and computer, including but not limited to your IP address, browser type, use of language, access date and time, software and hardware features, and other data. This information may be directly obtained by Binance or through third party services.</p>\n\n<p class=\"agreementConSubHeader\">2. Use of Information</p>\n\n<p>Without prior consent, Binance will not provide, sell, lease, share or trade your personal information to any third party sources. If you are engaged to any services provided by third party companies and/or Binance affiliated companies, they will be denied access to your information, unless required by law.</p>\n\n<p>Binance does not allow the collection, editing, or selling of your personal information in any way. Binance has the right to terminate the service of any users found engaging in the above activities mentioned.</p>\n\n<p class=\"agreementConSubHeader\">3. Information Disclosure</p>\n\n<p>Under the following circumstances, Binance will disclose your personal information in full or in part:</p>\n\n<p>With your prior consent, Binance may disclose your personal information to a third party;</p>\n\n<p>You are required to disclose your details if you are found to be in violation of laws of your jurisdiction, regulations or Binance service agreements or related rules;</p>\n\n<p>Your personal information will be disclosed to third party sources to provide you with products and service information as per requested;</p>\n\n<p>Binance reserves the right to decide to provide any necessary information or contact information to facilitate the completion of a transaction or dispute resolution during a transaction created on the Binance platform.</p>\n\n<p class=\"agreementConSubHeader\">4. The storage and exchange of information</p>\n\n<p>Any information collected by Binance or Binance affiliated companies will be stored on its servers. These data may be transmitted without respect to jurisdiction to any servers operated by Binance.</p>\n\n<p class=\"agreementConSubHeader\">5. The use of Cookies</p>\n\n<p>Binance platform uses cookies to provide you with a more personalized service, including promotional services. You have the right to accept or reject cookies. You can choose to accept cookies by modifying your browser settings. In the event that you refuse to accept cookies, you may not be able to log in or use Binance platform services or any functions that rely on cookies.</p>\n\n<p class=\"agreementConSubHeader\">6. Information security</p>\n\n<p>Your account has a security feature to protect your account and password information. Binance has security measures in place to ensure that your information is not lost, abused, or altered. Despite the aforementioned security measures, please take note that there are no &ldquo;perfect&rdquo; security measures in the information network.</p>\n\n<p>Please protect your personal information, and only provide personal information when absolutely necessary while using Binance platform services for online transactions. If you suspect that your personal information has been compromised, especially account and/or password information, please contact Binance customer service immediately.</p>\n</div>', '1'),
